import React from "react"
import './App.css'
import Nav from './Navbar'
import Aboutcont from "./About/Aboutcont";
import Footer from './Footer.js';

const About = () =>{
  return(
    <>
    <Nav/>
    <Aboutcont/>
    <div style={{fontFamily:"cursive"}}>
    <Footer/>
    </div>
    
    </>
  )
}

export default About
